sourcesContent:
import db from "../models";
import bcrypt from 'bcryptjs'
import jwt from "jsonwebtoken";

const hashPassword = password => bcrypt.hashSync(password, bcrypt.genSaltSync(8))

export const register = (body) => new Promise( async (resolve,reject)=>{
    try {
        const response = await db.Customer.findOrCreate({
            where: {phone: body.phone},
            defaults: {
                ...body,
                password: hashPassword(body.password)
                
            }
        })
        resolve({
            err: response[1] ? 0 : 1,
            mess: response[1] ? 'Account registration is successful' : 'Account is already exists'
        })
    } catch (error) {
        reject(error)
    }
})

export const login = ({phone, password}) => new Promise( async (resolve,reject)=>{
    try {
        const response = await db.Customer.findOne({
            where: {phone},
            raw: true
        })
        const isCheck = response && bcrypt.compareSync(password, response.password) 
        const token = isCheck ? jwt.sign({id: response.id, name: response.name, phone: response.phone}, process.env.JWT_SECRET, {expiresIn: '5d'}) : null

        resolve({
            err: token ? 0 : 1,
            mess: token ? 'Login is successful' : response ? 'Password is wrong' : 'Acccount has not been registered',
            'access-token': `Bearer ${token}`
        })
    } catch (error) {
        reject(error)
    }
})

