      // define association here
    }
  }
  Socket.init({
    user_id: DataTypes.INTEGER,
    type: DataTypes.INTEGER,
    socket_id: DataTypes.STRING
  }, {
    sequelize,
    modelName: 'Socket',
  });
  return Socket;
};

